-- ---author:wangshuai---date:20250913-----for: 【JHHB-115】新增用户字段上一次修改密码的时间
-- 新增用户字段上一次修改密码的时间
ALTER TABLE `sys_user`
ADD COLUMN `last_pwd_update_time` datetime(0) NULL DEFAULT NULL COMMENT '上一次修改密码的时间' AFTER `position_type`;

-- 更新用户最后一次更新时间为系统时间
update sys_user set last_pwd_update_time = NOW() where last_pwd_update_time is null;

